import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import {environment} from "../../../../environments/environment";

@Injectable({
  providedIn: 'root'
})
export class RandomImageService {

  private readonly apiUrl = `${environment.apiUrl}/the-random-value/image`;

  constructor(private http: HttpClient) {}

getRandomImage(keywords?: string): Observable<{ image: string; description: string }> {
  const params: any = {};
  if (keywords) {
    params.keywords = keywords;
  }
  return this.http.get<{ image: string; description: string }>(this.apiUrl, { params });
}

 getInitialImageString(): string | null {
  return "data:image/png;base64,";
}

}
